import oak from './assets/professorOak.png';
import './App.css';
import Navbar from './Navbar/Navbar.js';
import React,{useState,useEffect} from 'react';

function App() {

  const [Testo,setTesto] = useState(`Ciao Gamer Facciamo un Gioco`);
  const [Contatore,setContatore] = useState(0);

  function ChangeText(value){
    switch(value){
      case 1:
        setTesto("Pippo1");
        break;
      case 2:
        setTesto("Pippo2");
        break;
    }
  }

  useEffect(()=>{
    ChangeText(Contatore)
  },[Contatore])

  return (
    <div>
      <div className="App">
        <header className="App-header">
          <img src={oak} className="oak" alt="logo" />
          <div className='comparsa' onClick={()=>{let copia = Contatore; setContatore(copia++); console.log(copia)}}>
              {Testo}
          </div>
        </header>
      </div>
    </div>
  );
}

export default App;
